import { useState } from "react"

function AddTodoBar() {
  return (
    <>
      <h1>Add to Todo List</h1>
      <form>
        <input value="Type the todo item" type="text"></input>
        <button> Add </button>
      </form>
    </>
  );
}

function ListTable({ list }) {
  const rows = [];

  list.forEach((item) => {
    rows.push()
  }
  )

  return (
    <>
      <table>
        <thead><tr>ListTable</tr></thead>
        <tbody>
          {rows}
        </tbody>
      </table>
    </>
  );
}

export default function App() {
  const [items, setItems] = useState([{ id: 0, item: "example", status: "active" }]);

  return (
    <>
      <AddTodoBar />
      <ListTable list={items} />
    </>
  );
}
